import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import LoginPage from './components/LoginPage';
import DirectorDashboard from './components/dashboards/DirectorDashboard';
import InventoryManagerDashboard from './components/dashboards/InventoryManagerDashboard';
import STEMbassadorDashboard from './components/dashboards/STEMbassadorDashboard';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LoginPage />} />
        <Route path="/dashboard/director" element={<DirectorDashboard />} />
        <Route path="/dashboard/inventory" element={<InventoryManagerDashboard />} />
        <Route path="/dashboard/stembassador" element={<STEMbassadorDashboard />} />
      </Routes>
    </Router>
  );
}

export default App;
